import React from "react";
import "./Footer.css";
import {
  FaFacebook,
  FaLinkedin,
  FaMailBulk,
  FaPhone,
  FaSearchLocation,
  FaTwitter,
} from "react-icons/fa";

const Footer = () => {
  return (
    <div className="footer-container">
    <footer>
      <p>
        Created by: <a href="https://www.twitter.com/wilhelmgroth">Twitter</a>{" "}
        /<a href="https://www.linkedin.com/in/wilhelmgroth/">LinkedIn</a> /
        <a href="https://github.com/wilhelmgroth" target="_blank">
          GitHub
        </a>
        /
        <a href="https://www.instagram.com/wilhelmgroth" target="_blank">
          {" "}
          Instagram
        </a>
        / 2022
      </p>
    </footer>
  </div>
  );
};

export default Footer;
